    data: |
      SELECT ALL + col2 * tab0.col1 AS col2 FROM tab0 (FORMAT parquet) WHERE NOT + col1 * + col2 BETWEEN - col1 AND ( + col0 );
  - name: tab0

outputs:
  - name: q9810.out
    data: |
      2838
      7462
      97
